pragma solidity ^0.6.0;
 contract Vars{
     uint i = 69;
     function set_uint(uint _inp) public{
         i = _inp;
     }
     function get_uint() public view returns (uint){
        return i; 
     }
     function dec_uint()public returns(uint){
         return i--;
     }
     function inc_uint()public returns(uint){
         return i++;
     }

     bool b = true;
     function set_bool (bool _inp) public{
         b = _inp;
     }
     function get_bool() public view returns (bool){
        return b; 
     }

     //unsigned intergers in solidity implicitly wrap around i.e on exceeding their range they reset to the other boundary value without any warning

    //address type

    address public ad;
    function set_adress(address _ad) public{
        ad = _ad;
    }
    function get_bal() public view returns(uint) {
        return (ad.balance)/1000000000000000000;
    }

    //strings
    //for strings or any other reference types we have to specify storage location with the keyword 'memory' while using it as a parameter
    string public str;
    function set_str (string memory _str) public {
        str = _str;
    }

    //bytes
    bytes public by;
    function set_by (bytes memory _by) public{
        by = _by;
    }
 }
